import React from 'react';
import '../src/styles/Nav.css';

function Nav() {
  return (
    <div className="nav-bar">
      <ul>
        <li>Home</li>
        <li>Continents</li>
        <li>Contact Us</li>
      </ul>
    </div>
  );
}

export default Nav;
